import React from "react";
import CustomModal from "./modal";
import { Card, Row, Col } from 'antd';

import dxc from "../img/svg/dxc.svg"
//import stock
import stock from "../img/image1.jpg";
import stock1 from "../img/image2.jpg";
import stock2 from "../img/image3.jpg";
import stock3 from "../img/image4.jpg";
import stock4 from "../img/image5.jpg";
import stock5 from "../img/image6.jpg";

const { Meta } = Card;

class Portfolio extends React.Component {
  state = {
    isModalOpen: false,
  }
  render() {
    return (
      <>
        {this.state.isModalOpen && <CustomModal></CustomModal>}
        <section id="work" className="portfolio-mf sect-pt4 route">
          <div className="container">
            <div className="row">
              <div className="col-sm-12">
                <div className="title-box text-center">
                  <h3 className="title-a">Portfolio</h3>
                  <p className="subtitle-a">
                    Incididunt nostrud id aute culpa excepteur pariatur consequat
                    elit culpa nulla enim anim incididunt.
                  </p>
                  <div className="line-mf"></div>
                </div>
              </div>
            </div>
            <Row>
              <Col span={12}>
                <Card
                  style={{ width: 450, padding: '25px' }}
                  cover={
                    <img
                      alt="example"
                      src={dxc}
                    />
                  }
                >
                  <Meta
                    title="Software Engineer @ Deliveree On-Demand Logistics"
                    description="03/2019 - 04/20199"
                  />
                </Card>
              </Col>
              <Col span={12}>
                <Card
                  style={{ width: 450, padding: '25px' }}
                  cover={
                    <img
                      alt="example"
                      src={dxc}
                    />
                  }
                >
                  <Meta
                    title="Associate Software Engineer @ DXC Technology"
                    description="09/2017 - 03/2019"
                  />
                </Card>
              </Col>
            </Row>
          </div>
        </section>
      </>
    );
  }
}

export default Portfolio;
